import logo from './logo.svg';
import {getCoinbasePrice, getCryptoPrice} from './common/APIUtils';
import './App.css';

function App() {
  let coinbasePrice = {};
  getCoinbasePrice('eth').then((data) => {
    coinbasePrice = data;
  });
  let cryptoPrice = {};
  getCryptoPrice('eth').then((data) => {
    cryptoPrice = data;
  });

  console.log(coinbasePrice);
  console.log(cryptoPrice);

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          {0}
        </p>
        <p>
          {0}
        </p>
      </header>
    </div>
  );
}

export default App;
